import Header from "../components/Header";
import Footer from "../components/Footer";
import "../styles/CV.css";
//import fondCV from "../images/fondCV.jpg";

function CV() {
	return (
		<div>
			<div className="fond">
				<img className="backCV" src={fondCV} alt="fondCV" />

				<Header />
				<div className="CV">
					<img src="../assets/images/CV.png" alt="" />
				</div>
				<Footer />
			</div>
		</div>
	);
}

export default CV;
